import React from 'react';
import {Navbar, Container, Nav, Form, FormControl, Button} from 'react-bootstrap';

function Footer() {
    return (
        <Navbar expand="lg" variant="light" bg="light">
        <Container>
            <Navbar.Brand href="#">Navbar</Navbar.Brand>
        </Container>
        </Navbar>
    );
}

export default Footer;
